        def wrapper(self, *args, **kwargs):
            if lock is not None:
                with lock:
                    k = key(self, *args, **kwargs)
                    if k in cache:
                        return cache[k]
                    else:
                        result = func(self, *args, **kwargs)
                        cache[k] = result
