def size_to_bytes(size: str) -> int:
    """
    Convert human readable file size to bytes

    Args:
        size: str, a string representing a human readable file size (eg: '500K')
    Returns:
        int: file size in bytes
    """
    size = size.strip()
    if not size:
        return 0
    last_char = size[-1].upper()
    if last_char in ['K', 'M', 'G', 'T']:
        multiplier = 1024 ** ('KMGT'.index(last_char))
        return int(float(size[:-1]) * multiplier)
    else:
        return int(size)

def _dictsum(dicts):
    """
    Sum values with the same key in the dictionaries. And return a new dictionary.
    Example:
        given two dictionaries: dict1: {'a': 1, 'b': 2}, dict2: {'a': 5, 'b': 0}
        return a dictionary: dic:{'a': 6, 'b': 2}
    Returns: dict
    """
    result = {}
    for d in dicts:
        for key, value in d.items():
            if key in result:
                result[key] += value
            else:
                result[key] = value
    return result

